import React, { useEffect, useState } from "react";
import axios from "axios";

const Dashboard = () => {
  const [jobs, setJobs] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchJobs = async () => {
      try {
        const token = localStorage.getItem("token"); // JWT from login
        const res = await axios.get("http://localhost:8000/api/jobs/", {
          headers: { Authorization: `Bearer ${token}` },
        });
        setJobs(res.data);
      } catch (err) {
        console.error(err);
      } finally {
        setLoading(false);
      }
    };

    fetchJobs();
  }, []);

  if (loading) return <div>Loading jobs...</div>;

  return (
    <div>
      <h1>Dashboard</h1>
      <button onClick={() => { localStorage.removeItem("token"); window.location.reload(); }}>Logout</button>
      {jobs.length === 0 ? (
        <p>No jobs found matching your profile.</p>
      ) : (
        <ul>
          {jobs.map((job, index) => (
            <li key={index}>
              <h3>{job.title} - {job.company}</h3>
              <p>Domain: {job.domain}</p>
              <p>Role: {job.role}</p>
              <p>Experience: {job.experience} yrs</p>
              <p>Location: {job.location}</p>
              <p>Visa: {job.visa_sponsorship}</p>
              <p>Work mode: {job.work_mode}</p>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Dashboard;
